import React from 'react';
import '../styles.scss';
import header from '../assets/header.jpg';
import Hero from '../components/hero';

function Home() {
  return (
    <div className="App">
      <header className="App-header">

        <Hero image={header} />
      </header>
    </div>
  );
}

export default Home;
